	/**
	 * 设置图片的大小
	 * 
	 * @param savePath
	 *            存放目录
	 * @param picFrom
	 *            源图地址
	 * @param picTo
	 *            新图保存地址
	 * @param width
	 *            新图宽度
	 * @param height
	 *            新图高度
	 * @return
	 */
	public static void resize(String savePath, String picFrom, String picTo,
			int width, int height) throws IOException {

		Thumbnails.of(new File(savePath, picFrom)).forceSize(width, height)
				.toFile(new File(savePath, picTo));
	}

	/**
	 * 转换Nx图片
	 * 
	 * @param srcPath
	 *            源图目录
	 * @param optPath
	 *            新图保存目录
	 * @param picFrom
	 *            源图地址
	 * @param picTo
	 *            新图保存地址
	 * @param width
	 *            新图宽度
	 * @param height
	 *            新图高度
	 * @return
	 */
	public static void resizeNx(String srcPath, String optPath, String picFrom,
			String picTo, int width, int height, boolean forceSize)
			throws IOException {

		File srcImg = new File(srcPath, picFrom);
		File destImg = new File(optPath, picTo);
		BufferedImage bi = null;
		try {
			bi = ImageIO.read(srcImg);
		} catch (IOException e) {
			// 取分辨率出问题则忽略转换记日志
			log.info("ImageIO读取原图出错:" + srcImg.getAbsolutePath());
			return;
		}
		if (forceSize) {
			//forceSize=true时强制转为指定尺寸,不保持原图比例
			Thumbnails.of(srcImg).forceSize(width, height).toFile(destImg);
		} else {
			if ( (bi.getWidth() < width && bi.getHeight() < height) || (bi.getWidth() == width && bi.getHeight() == height)  ) {
				// 原图宽高都小于转换目标,则直接复制
				copyFile(srcImg, destImg);
			} else {
				// 否则进行图象转换
				Thumbnails.of(srcImg).size(width, height).toFile(destImg);
			}
		}
	}

	/**
	 * 给图片加水印
	 * 
	 * @param savePath
	 *            存放目录
	 * @param picFrom
	 *            源图地址
	 * @param picTo
	 *            新图保存地址
	 * @param width
	 *            新图宽度
	 * @param height
	 *            新图高度
	 * @return
	 */
	public static void watermark(String savePath, String pic)
			throws IOException {
		Thumbnails
				.of(new File(savePath, pic))
				.allowOverwrite(true)
				.scale(1.0f)
				.watermark(Positions.CENTER,
						ImageIO.read(Resources.getResourceAsFile(WATERMARK)),
						0.5f).asFiles(Rename.NO_CHANGE);
	}

	/**
	 * 复制单个文件
	 * 
	 * @param srcFile
	 *            待复制的文件
	 * @param descFile
	 *            目标文件
	 * @return 如果复制成功返回true，否则返回false
	 */
	public static boolean copyFile(File srcFile, File destFile) {
		// 复制文件
		int byteread = 0; // 读取的字节数
		InputStream in = null;
		OutputStream out = null;

		try {
			in = new FileInputStream(srcFile);
			out = new FileOutputStream(destFile);
			byte[] buffer = new byte[1024 * 32];

			while ((byteread = in.read(buffer)) != -1) {
				out.write(buffer, 0, byteread);
			}
			return true;
		} catch (FileNotFoundException e) {
			return false;
		} catch (IOException e) {
			return false;
		} finally {
			try {
				if (out != null)
					out.close();
				if (in != null)
					in.close();
			} catch (IOException e) {
				e.printStackTrace();
			}
		}
	}
	
	
	 
		
