	/**
	 * 根据图片byte数组转换为本地系统的图片
	 * @param images
	 * @return   图片路径
	 * @throws Exception
	 */

	public static String parseImage(String images) throws Exception{
		
		String imagePath="";
		images=images.trim().replace(" ", "+");
		if(StringUtils.isNotBlank(images)){
			int index=images.indexOf(",");
			if(index>0){
				images=images.substring(index+1);
			}else if(index<0  &&  !Validator.isEmpty(images)){
				return images;
			}else {
				return " ";
			}
			try {
				//上传的是原图n4
				String forDate=sdf.format(new Date());
				String   path  = Resources.getData("UPLOAD_ROOT_FOLDER_URL") + "image/n4"+forDate;
				String   picture_path  = Resources.getData("UPLOAD_ROOT_FOLDER") + "image/n4"+forDate;
				
				// 创建新的文件名
				String newFileName = WebUtils.getTime("yyyyMMddHHmmss")+ WebUtils.getRandomString(5) + ".jpg";
				
				 File outputFile = new File(picture_path);
		            if (!outputFile.exists()) {
		            	outputFile.mkdirs();
					}
		            String n4Url=(picture_path + newFileName);
		            File newFile=new File(n4Url);
		            if(!newFile.exists()){
		            	newFile.createNewFile();
		            }
		            
		            FileImageOutputStream fios=new FileImageOutputStream(newFile);
		    		fios.write(Base64.decode(images));
		    		imageResize(picture_path,newFileName);
		    		
		    		imagePath=path+newFileName;
		    		if(!imagePath.equals("")){
		    			imagePath=imagePath.replaceAll("/n4", "/n0");
		    		}
		    		fios.flush();
		    		fios.close();
		    		 
				 } catch (IOException e) {
				  e.printStackTrace();
				 }
		}
		
			 
		return imagePath;
	}
	
	  
		
